import React from 'react';
import SplitPane from 'react-split-pane';
import './App.css';
import './styles/styles.css'
import EditorSection from './components/layout/editor-section';
import ProblemSection from './components/layout/problem-section';
import ResultSection from './components/layout/result-section';
import TestcaseSection from './components/layout/testcase-section';
import {Container, Row} from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <SplitPane
      split='vertical'
      defaultSize='45%'
      minSize={400}
      maxSize={900}
      >
        <ProblemSection/>
        <Container>
          <Row style={{height: '50%'}}><EditorSection/></Row>
          <Row style={{height: '20%'}}><TestcaseSection/></Row>
          <Row style={{height: '30%'}}><ResultSection/></Row>
        </Container>
      </SplitPane>
    </div>
  );
}

export default App;
